}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24">  <path d="M23,10H13V0H23V10ZM14,9h8V1H14V9Z" class="aw-theme-iconOutline" fill="#464646"/>  <path d="M11,23H1V13H11V23ZM2,22h8V14H2v8Z" class="aw-theme-iconOutline" fill="#464646"/>  <polygon points="6 14 5 14 5 11 18 11 18 9 19 9 19 12 6 12 6 14" class="aw-theme-iconOutline" fill="#464646"/></svg>';
        export const SvgComponent = React.memo(SvgComp);
